var Saint = require('../lib/saint'),
		creds = require('./test-credentials'),
		s = new Saint(creds.username, creds.sharedSecret, 'sanJose', {log: false}),
		testJobId = '';


module.exports.testGetJob = function(test){

	s.getJob(testExportData(), function(err, data){
		test.expect(1);
		if(err){
			s.logger("error", err);
			test.ok(false, err.message);
		}else{
			s.logger("info", data);
			if(data[0].status.toLowerCase() == 'completed' && data[1].status.toLowerCase() == 'ready' && parseInt(data[1].viewable_pages, 10) > 0){
				test.ok(true, "Saint Job Data: "+data);
			}else{
				test.ok(false, "Something went wrong. View response data: "+ data);
			}
		}
		test.done();
	});
}

module.exports.testBadGetJob = function(test){
	var testData = testExportData();
	// mess up the date format to generate error
	testData.relation_id = null;
	s.getJob(testData, function(err, data){
		test.expect(1);
		if(err){
			s.logger("error", err);
			test.ok(true, err.message);
			s.logger("info","Test was supposed to fail");
		}else{
			s.logger("info", data);
			if(data[0].status.toLowerCase() == 'completed' && data[1].status.toLowerCase() == 'ready' && parseInt(data[1].viewable_pages, 10) > 0){
				test.ok(false, "Saint Job Data: "+JSON.stringify(data));
				s.logger("info","Test was supposed to fail");
			}else{
				test.ok(true, "Something went wrong. View response data: "+ data);
				s.logger("info","Test was supposed to fail");
			}
		}
		test.done();
	});
}

module.exports.testGetJobSegment = function(test){
	
	s.getJob(testExportData(), function(err, data){
		test.expect(1);
		if(err){
			s.logger("error", err);
			test.ok(false, err.message);
			test.done();
		}else{
			s.logger("info", data);
			if(data[0].status.toLowerCase() == 'completed' && data[1].status.toLowerCase() == 'ready' && parseInt(data[1].viewable_pages, 10) > 0){
				s.getJobSegment(data[1].id, 1, function(err, segmentData){
					if(err){
						s.logger("error", err);
						test.ok(false, err.message);
					}else{
						s.logger("info", segmentData);
						test.ok(true, "Saint Job Data: "+ segmentData);
					}
					test.done();
				});
			}else{
				test.ok(false, "Something went wrong. View response data: "+ data);
				test.done();
			}
		}
	});
}

